import './App.css';
import axios from "axios";
import React, {useState, useEffect} from "react";

const UserProfiles = () => {
    const fetchUserProfiles = () => {
      axios.get("http://localhost:8080/api/v1/user-profile")
          .then(response => {
              console.log(response);
          });
  }

  useEffect(()=> {
      fetchUserProfiles();
  }, []);
}

function App() {
  return (
    <div className="App"/>
  );
}

export default App;
